		Eigen::MatrixXd Erro_CKF(24,1);
		Erro_CKF = (Xstates_CKF + (Eigen::MatrixXd(24,1) << Xeq.block(0,0,20,1), 0, 0, 0, 0).finished()) - Xref;
 

